import React from 'react';
import { dtnk } from 'react-router-dom';


export default class NetworkDeviceInformation extends React.Component {
	render() {
		return (
			<>

			<center>
				<dl>
					<dt>Windows Machine</dt>
					<dt>iPhone 10</dt>
					<dt>Amazon Firestick 1</dt>
					<dt>Router</dt>
					<dt>Modem</dt>
				</dl>
			</center>

			</>
		);
	}
}
